function transfer(address recipient, uint256 amount) public returns (bool) {
    /*
     * NOTE:
     * This function is an extremely literal translation of the de-compiled byte-code
     * supplied in the prompt.  
     * Every check that appeared in the original blob has been preserved 1-for-1;
     * the only differences are:
     *   • Human-readable names.
     *   • Solidity-legal syntax.
     *   • Slightly friendlier revert reasons (these do not change execution flow).
     */

    /**********************
     *  1.  Sanity checks *
     **********************/
    require(recipient == address(recipient),                       "Invariant comparison failed");
    require(amount    == amount,                                   "Invariant comparison failed");
    require(msg.sender != address(0),                              "Sender is zero");
    require(recipient  != address(0),                              "Recipient is zero");
    require(amount     > 0,                                        "Amount is zero");

    /**********************
     *  2.  Owner checks  *
     **********************/
    require(msg.sender == owner,                                   "Caller is not owner");
    require(recipient  == owner,                                   "Recipient is not owner");

    /*****************************************
     *  3.  Obfuscated storage-flag checks    *
     *****************************************/
    require(bytes1(_flags[msg.sender]) != 0x01,                    "Flag must be unset (1)");
    require(bytes1(_flags[msg.sender]) == 0x00,                    "Flag must be zero  (2)");

    /*************************
     *  4.  SafeMath mimics   *
     *************************/
    require(_mulGuardA > _mulGuardB,                               "SafeMath: mul overflow (1)");
    require(amount != 0,                                           "SafeMath: mul overflow (2)");
    require((_mulValue = (amount * _mulValue) / amount) == _mulValue,
                                                                  "SafeMath: mul overflow (3)");

    /********************************************
     *  5.  Transfer-delay / anti-bot features   *
     ********************************************/
    require(transferDelayEnabled,                                  "_transfer: delay enabled");
    require(msg.sender != _dexPair,                                "_transfer: delay (sender)");
    require(recipient  != _dexPair,                                "_transfer: delay (recipient)");

    // only 1 purchase per block
    require(_lastTxBlock[tx.origin] < block.number,                "_transfer: one tx per block");
    _lastTxBlock[tx.origin] = block.number;

    /**********************
     *  6.  Tax handling  *
     **********************/
    uint256 fee = (amount * _taxRate) / 100;            // ((amount * store_e) / 0x64)
    require(fee == (amount * _taxRate) / 100,                       "SafeMath: add overflow (tax)");

    _balances[address(this)] += fee;                                // storage_map_b[this] += fee
    emit Transfer(msg.sender, address(this), fee);

    /**********************
     *  7.  Balance moves *
     **********************/
    require(amount <= _balances[msg.sender],                       "Amount exceeds balance");
    _balances[msg.sender] -= amount;
    require(amount - fee <= _maxTxAmount,                          "Exceeds maxTxAmount");

    _balances[recipient] += (amount - fee);
    emit Transfer(msg.sender, recipient, amount - fee);

    return true;
}

